import React, { Component } from "react";
import CardComponent from "./CardComponent.jsx";
import * as externalRoutes from "./../../../constants/externalRoutes";
import SEMANTIC_COLORS from "./../../../constants/propObjectContainer.js"

class CardContainer extends Component {
	render() {
		const generateColor = () => {
			const randomNum = Math.floor(Math.random() * 14); 
			return Object.keys(SEMANTIC_COLORS)[randomNum];
		}

		const props = { image: this.props.image, header: this.props.header, meta: <a
					href={externalRoutes.MET_MUSEUM}
				>
					{this.props.meta}
				</a>, description: this.props.description, color: this.props.generateColorthis.props.color, onClick: this.props.onClick, generateColor: this.props.generateColor }; //remove a tag

		return <CardComponent {...props} />;
	}
}

export default CardContainer;
